import React from 'react';


const ExpenseTracker = () => {
  const [expenses, setExpenses] = useState([]);
  const [projectSuggestions, setProjectSuggestions] = useState([]);

  useEffect(() => {
    // Load saved expenses and project suggestions from local storage
    const savedExpenses = JSON.parse(localStorage.getItem('expenses')) || [];
    const savedSuggestions = JSON.parse(localStorage.getItem('projectSuggestions')) || [];
    setExpenses(savedExpenses);
    setProjectSuggestions(savedSuggestions);
  }, []);

  useEffect(() => {
    // Save expenses and project suggestions to local storage
    localStorage.setItem('expenses', JSON.stringify(expenses));
    localStorage.setItem('projectSuggestions', JSON.stringify(projectSuggestions));
  }, [expenses, projectSuggestions]);

  const handleInputChange = (index, field, value) => {
    const updatedExpenses = [...expenses];
    updatedExpenses[index][field] = value;

    if (field === 'project' && !projectSuggestions.includes(value)) {
      setProjectSuggestions([...projectSuggestions, value]);
    }

    if (field === 'quantity' || field === 'unitPrice') {
      updatedExpenses[index].totalPrice = updatedExpenses[index].quantity * updatedExpenses[index].unitPrice;
    }

    setExpenses(updatedExpenses);
  };

  const addNewExpense = () => {
    setExpenses([...expenses, { project: '', quantity: 0, unitPrice: 0, totalPrice: 0, actualPaid: '' }]);
  };

  const calculateTotal = (field) => {
    return expenses.reduce((sum, expense) => {
      const value = field === 'actualPaid' && expense[field] === '' ? expense.totalPrice : expense[field];
      return sum + (parseFloat(value) || 0);
    }, 0).toFixed(2);
  };

  return (
    <div style={{ padding: '1rem' }}>
      <table style={{ width: '100%', borderCollapse: 'collapse' }}>
        <thead>
          <tr>
            <th style={tableHeaderStyle}>项目</th>
            <th style={tableHeaderStyle}>数量</th>
            <th style={tableHeaderStyle}>单价</th>
            <th style={tableHeaderStyle}>总价</th>
            <th style={tableHeaderStyle}>实付</th>
          </tr>
        </thead>
        <tbody>
          {expenses.map((expense, index) => (
            <tr key={index}>
              <td style={tableCellStyle}>
                <input
                  list={`projects-${index}`}
                  value={expense.project}
                  onChange={(e) => handleInputChange(index, 'project', e.target.value)}
                  style={inputStyle}
                />
                <datalist id={`projects-${index}`}>
                  {projectSuggestions.map((suggestion, i) => (
                    <option key={i} value={suggestion} />
                  ))}
                </datalist>
              </td>
              <td style={tableCellStyle}>
                <input
                  type="number"
                  value={expense.quantity}
                  onChange={(e) => handleInputChange(index, 'quantity', parseFloat(e.target.value))}
                  style={inputStyle}
                />
              </td>
              <td style={tableCellStyle}>
                <input
                  type="number"
                  step="0.01"
                  value={expense.unitPrice}
                  onChange={(e) => handleInputChange(index, 'unitPrice', parseFloat(e.target.value))}
                  style={inputStyle}
                />
              </td>
              <td style={tableCellStyle}>{expense.totalPrice.toFixed(2)}</td>
              <td style={tableCellStyle}>
                <input
                  type="number"
                  step="0.01"
                  value={expense.actualPaid}
                  onChange={(e) => handleInputChange(index, 'actualPaid', e.target.value)}
                  placeholder={expense.totalPrice.toFixed(2)}
                  style={inputStyle}
                />
              </td>
            </tr>
          ))}
          <tr>
            <td colSpan={3} style={tableCellStyle}>总计</td>
            <td style={tableCellStyle}>{calculateTotal('totalPrice')}</td>
            <td style={tableCellStyle}>{calculateTotal('actualPaid')}</td>
          </tr>
        </tbody>
      </table>
      <button 
        onClick={addNewExpense}
        style={{
          marginTop: '1rem',
          padding: '0.5rem 1rem',
          backgroundColor: '#3b82f6',
          color: 'white',
          border: 'none',
          borderRadius: '0.25rem',
          cursor: 'pointer'
        }}
      >
        添加新项目
      </button>
    </div>
  );
};

const tableHeaderStyle = {
  backgroundColor: '#f3f4f6',
  padding: '0.5rem',
  borderBottom: '1px solid #e5e7eb',
  textAlign: 'left'
};

const tableCellStyle = {
  padding: '0.5rem',
  borderBottom: '1px solid #e5e7eb'
};

const inputStyle = {
  width: '100%',
  padding: '0.25rem',
  border: '1px solid #d1d5db',
  borderRadius: '0.25rem'
};

export default function App() {
  return <ExpenseTracker />;
}
